		function moveBallsL15() {
			var tempbb;
			var tempb2;
			for (var ii = mcsbinnen.length-1;ii>=0;ii--) {
				tempbb = mcsbinnen[ii];
				tempbb.vx *= .97;
				tempbb.vy *= .97;
				tempbb.vy += .7;
				var fx = 0.0;
				var fy = 0.0;
				if (tempbb.naam==1) bbstraal=75;
				else if (tempbb.naam==2) bbstraal=45;
				else if (tempbb.naam==3) bbstraal=125;
				else if (tempbb.naam==4) bbstraal=30;
				else if (tempbb.naam==5) bbstraal=105;
				else if (tempbb.naam==6) bbstraal=60;
				else if (tempbb.naam==7) bbstraal=90;
				else if (tempbb.naam==8) bbstraal=165;
				else if (tempbb.naam==9) bbstraal=145;
				// collision met balls binnen
				for (var i = mcsbinnen.length-1;i>=0;i--) {
					tempb2 = mcsbinnen[i];
					var ddx = tempbb.x-tempb2.x;
					var ddy = tempbb.y-tempb2.y;
					var distance = Math.sqrt((ddx * ddx) + (ddy * ddy));
					if (tempb2.naam==1) b2straal=75;
					else if (tempb2.naam==2) b2straal=45;
					else if (tempb2.naam==3) b2straal=125;
					else if (tempb2.naam==4) b2straal=30;
					else if (tempb2.naam==5) b2straal=105;
					else if (tempb2.naam==6) b2straal=60;
					else if (tempb2.naam==7) b2straal=90;
					else if (tempb2.naam==8) b2straal=165;
					else if (tempb2.naam==9) b2straal=145;
					if (tempbb!=tempb2 && (distance < (bbstraal + b2straal))) {
						var dx = (tempbb.x+tempbb.vx) - tempb2.x;
						var dy = (tempbb.y+tempbb.vy) - tempb2.y;
						var dist = Math.sqrt(dx*dx+dy*dy);
						var dmax = bbstraal+b2straal - dist;
						if (dmax > 0) {
							var mag1 = dmax*.5/dist;
							fx += dx*mag1;
							fy += dy*mag1;
						}
					}
				}
				// collision met vaste ping balls
				for (var j = 7;j>=1;j--) {
					if (j==1) {tempb2 = sceneScherm.l15colbal1;b2straal=20;}
					else if (j==2) {tempb2 = sceneScherm.l15colbal2;b2straal=40;}
					else if (j==3) {tempb2 = sceneScherm.l15colbal3;b2straal=30;}
					else if (j==4) {tempb2 = sceneScherm.l15colbal4;b2straal=54;}
					else if (j==5) {tempb2 = sceneScherm.l15colbal5;b2straal=40;}
					else if (j==6) {tempb2 = sceneScherm.l15colbal6;b2straal=16;}
					else if (j==7) {tempb2 = sceneScherm.l15colbal7;b2straal=16;}
					var d2x = tempbb.x-tempb2.x;
					var d2y = tempbb.y-tempb2.y;
					var distance = Math.sqrt((d2x * d2x) + (d2y * d2y));
					if (distance < (bbstraal + b2straal)) {
						var dx2 = (tempbb.x+tempbb.vx) - tempb2.x;
						var dy2 = (tempbb.y+tempbb.vy) - tempb2.y;
						var dist2 = Math.sqrt(dx2*dx2+dy2*dy2);
						var dmax2 = bbstraal+b2straal - dist2;
						if (dmax2 > 0) {
							var mag12 = dmax2*.5/dist2;
							fx += dx2*mag12;
							fy += dy2*mag12;
						}
					}
				}
				tempbb.vx += fx;
				tempbb.vy += fy;
				// bounce off floor and ceiling
				if (tempbb.y+bbstraal+tempbb.vy>=720) {
					tempbb.vy *= -.5;
				}
				// bounce off right and left wall
				if ((tempbb.x-bbstraal) + tempbb.vx <= 0 || tempbb.x+bbstraal + tempbb.vx >= 1280) tempbb.vx *= -.5;
				tempbb.vx *= .97;
				tempbb.vy *= .97;
				//reduce bibber
				if (tempbb.vx < .2 && tempbb.vx > -.2) tempbb.vx = 0;
				if (tempbb.vy < .2 && tempbb.vy > -.2) tempbb.vy = 0;
				if(tempbb.vx>1||tempbb.vx<-1)tempbb.x+=tempbb.vx;
				if(tempbb.vy>1||tempbb.vy<-1)tempbb.y+=tempbb.vy;
			}
		}
