		function l18LxxstartSwipe(e) {
			if (!levelblocked) {
				muisx1 = sceneScherm.globalToLocal(stage.mouseX, stage.mouseY).x; muisy1 = sceneScherm.globalToLocal(stage.mouseX, stage.mouseY).y;
			}
		}
		function l18LxxstopSwipe(e) {
			if (!levelblocked) {
				if (muisx1 == -1) return;
				muisx2 = sceneScherm.globalToLocal(stage.mouseX, stage.mouseY).x; muisy2 = sceneScherm.globalToLocal(stage.mouseX, stage.mouseY).y;
				if (Math.abs(muisy2 - muisy1) < Math.abs(muisx2 - muisx1)) {
					if ((muisx2 - muisx1) > swipeafstand) swipeArray.push(1);
					else if ((muisx2 - muisx1) < -swipeafstand) swipeArray.push(2);
				} else {
					if ((muisy2 - muisy1) > swipeafstand) swipeArray.push(3);
					else if ((muisy2 - muisy1) < -swipeafstand) swipeArray.push(4);
				}
				muisx1 = sceneScherm.globalToLocal(stage.mouseX, stage.mouseY).x; muisy1 = sceneScherm.globalToLocal(stage.mouseX, stage.mouseY).y;
			}
		}
		
		function checkKeys(evt) {
			if ((evt.keyCode == 39 || evt.keyCode == 68)) {
				swipeArray.push(1);
			}
			if ((evt.keyCode == 38 || evt.keyCode == 87)) {
				swipeArray.push(4);
			}
			if ((evt.keyCode == 37 || evt.keyCode == 65)) {
				swipeArray.push(2);
			}
			if ((evt.keyCode == 40 || evt.keyCode == 83)) {
				swipeArray.push(3);
			}
		}
		
