				sceneScherm.hintveld.hinttxt.text = "HINT "+sceneScherm.hintindex +"/"+ sceneScherm.hints[sceneScherm.lvl - 1].length+": "+ sceneScherm.hints[sceneScherm.lvl - 1][sceneScherm.hintindex-1];
