		function moveBallsOutro() {
			var tempbb;
			var tempb2;
			for (var ii = mcsbinnen.length-1;ii>=0;ii--) {
				tempbb = mcsbinnen[ii];
				tempbb.vx *= .97;
				tempbb.vy *= .97;
				tempbb.vy += .7;
				if (tempbb.tel==1) cBallRadius=cBallRadius1;
				else if (tempbb.tel==2) cBallRadius=cBallRadius2;
				else if (tempbb.tel==3) cBallRadius=cBallRadius3;
				else if (tempbb.tel==4) cBallRadius=cBallRadius4;
				else if (tempbb.tel==5) cBallRadius=cBallRadius5;
				else if (tempbb.tel==6) cBallRadius=cBallRadius6;
				else if (tempbb.tel==7) cBallRadius=cBallRadius7;
				else if (tempbb.tel==8) cBallRadius=cBallRadius8;
				else if (tempbb.tel==9) cBallRadius=cBallRadius9;
				else if (tempbb.tel==10) cBallRadius=cBallRadius10;
				else if (tempbb.tel==11) cBallRadius=cBallRadius11;
				else if (tempbb.tel==12) cBallRadius=cBallRadius12;
				else if (tempbb.tel==13) cBallRadius=cBallRadius13;
				else if (tempbb.tel==14) cBallRadius=cBallRadius14;
				else if (tempbb.tel==15) cBallRadius=cBallRadius15;
				else if (tempbb.tel==16) cBallRadius=cBallRadius16;
				else if (tempbb.tel==17) cBallRadius=cBallRadius17;
				else if (tempbb.tel==18) cBallRadius=cBallRadius18;
				else if (tempbb.tel==19) cBallRadius=cBallRadius19;
				else if (tempbb.tel==20) cBallRadius=cBallRadius20;
				else if (tempbb.tel==21) cBallRadius=cBallRadius21;
				var fx = 0.0;
				var fy = 0.0;
				for (var i = mcsbinnen.length-1;i>=0;i--) {
					tempb2 = mcsbinnen[i];
					if (tempb2.tel==1) cBallRadius_2=cBallRadius1;
					else if (tempb2.tel==2) cBallRadius_2=cBallRadius2;
					else if (tempb2.tel==3) cBallRadius_2=cBallRadius3;
					else if (tempb2.tel==4) cBallRadius_2=cBallRadius4;
					else if (tempb2.tel==5) cBallRadius_2=cBallRadius5;
					else if (tempb2.tel==6) cBallRadius_2=cBallRadius6;
					else if (tempb2.tel==7) cBallRadius_2=cBallRadius7;
					else if (tempb2.tel==8) cBallRadius_2=cBallRadius8;
					else if (tempb2.tel==9) cBallRadius_2=cBallRadius9;
					else if (tempb2.tel==10) cBallRadius_2=cBallRadius10;
					else if (tempb2.tel==11) cBallRadius_2=cBallRadius11;
					else if (tempb2.tel==12) cBallRadius_2=cBallRadius12;
					else if (tempb2.tel==13) cBallRadius_2=cBallRadius13;
					else if (tempb2.tel==14) cBallRadius_2=cBallRadius14;
					else if (tempb2.tel==15) cBallRadius_2=cBallRadius15;
					else if (tempb2.tel==16) cBallRadius_2=cBallRadius16;
					else if (tempb2.tel==17) cBallRadius_2=cBallRadius17;
					else if (tempb2.tel==18) cBallRadius_2=cBallRadius18;
					else if (tempb2.tel==19) cBallRadius_2=cBallRadius19;
					else if (tempb2.tel==20) cBallRadius_2=cBallRadius20;
					else if (tempb2.tel==21) cBallRadius_2=cBallRadius21;
					var dx;
					var dy;
					var dist;
					dx = tempbb.x - tempb2.x;
					dy = tempbb.y - tempb2.y;
					dist = Math.sqrt(dx*dx+dy*dy);
					if (tempbb!=tempb2 && dist<(cBallRadius+cBallRadius_2)) {
						dx = (tempbb.x+tempbb.vx) - tempb2.x;
						dy = (tempbb.y+tempbb.vy) - tempb2.y;
						dist = Math.sqrt(dx*dx+dy*dy);
						var dmax = cBallRadius+cBallRadius_2 - dist;
						if (dmax > 0) {
							var mag1 = dmax*.5/dist;
							fx += dx*mag1;
							fy += dy*mag1;
						}
					}
				}
				tempbb.vx += fx;
				tempbb.vy += fy;
				// bounce off floor and ceiling
		//		if (tempbb.y+cBallRadius+tempbb.vy>=720+100) {
				if (tempbb.y+cBallRadius+tempbb.vy>=720+300) {
					tempbb.y -= 1020;
		//tempbb.vy *= -.5;
				}
				// bounce off right and left wall
				if ((tempbb.x-cBallRadius) + tempbb.vx <= 0 || tempbb.x+cBallRadius + tempbb.vx >= 1280) tempbb.vx *= -.5;
				tempbb.vx *= .97;
				tempbb.vy *= .97;
				//reduce bibber
				if (tempbb.vx < .2 && tempbb.vx > -.2) tempbb.vx = 0;
				if (tempbb.vy < .2 && tempbb.vy > -.2) tempbb.vy = 0;
				if(tempbb.vx>1||tempbb.vx<-1)tempbb.x+=tempbb.vx;
				if(tempbb.vy>1||tempbb.vy<-1)tempbb.y+=tempbb.vy;
			}
		}
				
		
